import styled from "styled-components";

export const NavBarStyle = styled.div`
  width: 100%;
  height: 10vh;
  padding-left: 20px;
  padding-right:20px;
  display: flex;
  flex-direction: row;
  background-color: blueviolet;
  justify-content: end;
  color: white;
`;

export const MenuStyle = styled.div`
  width: 50%;
  height: 100%;
  display: flex;
  flex: auto;
  flex-direction: column;
  background-color: pink;
  color: white;
`;
